import './HeroImages.css';
import HeroImage from '../../assets/ImagesHeroImage.jpg'; // import image

export default function HeroImages() {
  return (
    <div className="hero-image-wrapper">
      <img src={HeroImage} alt="hero" className="hero-image" />
    </div>
  );
}
